import "./App.css";
import Header from "./components/Header";
import TitleSection from "./components/TitleSection";
import Form from "./components/Form";
import LanguageSelector from "./components/LanguageSelector";
import { BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import germanFlag from './images/german.png';
import italianFlag from './images/italian.png';
import englishFlag from './images/english.png';

function App() {
  const [language, setLanguage] = useState("en");
  return (
    <Router>
      <div className="App">
        <Header />
        <main>
          <TitleSection />
          <LanguageSelector />
          <Link to="/german"><img src={ germanFlag } alt="German Flag" style={{ width: '25px', height: '25px', float: 'right', marginTop: '5px', marginRight: '10px' }} /></Link>
          <Link to="/italian"><img src={italianFlag} alt="Italian Flag" style={{ width: '25px', height: '25px',  float: 'right', marginTop: '5px', marginRight: '10px'}}/></Link>
          <Link to="/english"><img src={englishFlag} alt="English Flag" style={{ width: '25px', height: '25px', float: 'right', marginTop: '5px', marginRight: '10px' }}/></Link>
        <Routes>
        <Route path="/german" element={<Form language="de" />} />
          <Route path="/italian" element={<Form language="it" />} />
          <Route path="/english" element={<Form language="en" />} />
          </Routes>
          </main>
      </div>
    </Router>
  );
}

export default App;
